import React from 'react';
import './App.css';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Profile from './components/Profile/Profile';
import Dialogs from "./components/Dialogs/Dialogs";
import News from "./components/News/News";
import Music from "./components/Music/Music";
import Route from "react-router-dom/es/Route";
import BrowserRouter from "react-router-dom/es/BrowserRouter";
import Switch from "react-router-dom/es/Switch";
import NotFound from "./components/NotFound/NotFound";
import DailyRoutine from "./components/DailyRoutine/DailyRoutine";
import {addNewPosts} from "./Redux/state";


const App = (props) => {
debugger;
    return (
        <BrowserRouter>
            <div className='app-wrapper'>

                <Header />
                <Navbar friends={props.state.friendsPage.friends}/>

                <Switch>
                    <Route path ='/dialogs' render ={()=> <Dialogs addUser={props.addUser}
                                                                   data={props.state.massegePage.data}
                                                                   message={props.state.massegePage.dataMessage}

                                                                                                                />} />
                    <Route path="/profile" render ={ ()=> <Profile posts={props.state.profilePage.posts} addPost={props.addNewPosts}
                                                                                                                />}/>
                    <Route path="/news" component={News}/>
                    <Route path="/music" component={Music}/>
                    <Route path="/dailyrountine" component={DailyRoutine}/>
                    <Route component={NotFound}/>
                </Switch>

            </div>
        </BrowserRouter>
    );
}

export default App;
